import React, {Component} from 'react';
import p5 from "p5";

class Simulations2 extends Component {
    constructor(props) {
        super(props);
        this.myRef1 = React.createRef();

        this.Sim2 = new p5(p => {

            p.setup = () => {
                p.createCanvas(600, 400).parent(this.myRef1.current);
            };
            p.draw = () => {
                p.background(255,205,100);
                p.fill(250);
                p.rect(30, 20, 55, 55);

            };
        });
    }


    render() {
        return (
            <div className="container">
                <div ref={this.myRef1} />
            </div>
        );
    }
}

export default Simulations2;
